import React from "react";
import { FirstName, LastName } from "./App";

const ComB = () => {
  return (
    <>
      <FirstName.Consumer>
        {(fname) => (
          <LastName.Consumer>
            {(lname) => {
              return (
                <h1>
                  My Name is {fname} {lname}
                </h1>
              );
            }}
          </LastName.Consumer>
        )}
      </FirstName.Consumer>
    </>
  );
};

export default ComB;
